import { Navbar, Container, NavbarBrand } from "react-bootstrap";

const NavigationBar = () => {
  return (
    <Navbar>
      <Container>
        <NavbarBrand>AksaraKU</NavbarBrand>
      </Container>
    </Navbar>
  );
};

export default NavigationBar;
